Letters left at the Hollywood Walk of Fame star for KABC radio broadcaster Michael Jackson in the days following the June 25, 2009, death of pop star Michael Jackson.

<a href="http://latimesblogs.latimes.com/lanow/2009/06/michael-jackson-7. html" rel="nofollow">According to the L.A. Times</a>, the pop star's actual star, which is located in front of Grauman’s Chinese Theatre on Hollywood Boulevard, was blocked by the premiere of Sacha Baron Cohen's new movie &quot;Bruno.&quot;

As a result, much of the early response to Jackson's death instead occurred on Vine St. at the other Jackson's star. The notes photographed here were found there on the afternoon of Saturday, June 27, 2009, two days after Jackson's death.

