A model poses for a photograph in the Garey St. alley between 2nd and 3rd streets in the Arts District of Downtown Los Angeles.

When asked what they were shooting for, the photographer said, &quot;Practice.&quot;

The graffiti contains the signature of <a href="http://www.mistercartoon.com/" rel="nofollow">Mr. Cartoon</a>, one of L.A.'s most famous tattoo artists. His semi-secretive shop is nearby.
